import { Component } from '@angular/core';
import {FormBuilder, FormGroup, ReactiveFormsModule, Validators} from "@angular/forms";

@Component({
  selector: 'app-signup',
  templateUrl: './signup.component.html',
  standalone: true,
  imports: [
    ReactiveFormsModule
  ],
  styleUrls: ['./signup.component.css']
})
export class SignupComponent {

  registrationForm : FormGroup;
  constructor(private formBuilder: FormBuilder) {
    this.registrationForm = this.formBuilder.group({
      email: ['', Validators.required],
      username: ['', Validators.required],
      password: ['', Validators.required],
      confirmPassword: ['', Validators.required],
    });
  }

  public onSubmit() {
    if (this.registrationForm.value.password !== this.registrationForm.value.confirmPassword) {
      console.log("Password doesnt match")
      return
    }

  }
}
<div class="flex flex-col items-center w-full bg-sky-950 justify-center" style="height: calc(100vh - 5rem)">
  <form [formGroup]="registrationForm" (ngSubmit)="onSubmit()" class="flex flex-col bg-white rounded w-4/12 p-4">
    <div class="mb-3">
      <label for="inputEmail" class="form-label">Email address</label>
      <input name="email" type="email" class="border-blue-300 form-control" id="inputEmail" aria-describedby="emailHelp">
      <div id="emailHelp" class="form-text">We'll never share your email with anyone else.</div>
    </div>
    <div class="mb-3">
      <label for="inputUsername" class="form-label">Username</label>
      <input name="username" type="text" class="border-blue-300 form-control" id="inputUsername" aria-describedby="emailHelp">
    </div>
    <div class="mb-3">
      <label for="inputPassword1" class="form-label">Password</label>
      <input name="password" type="password" class="border-blue-300  form-control" id="inputPassword1">
    </div>

    <div class="mb-3">
      <label for="inputPassword2" class="form-label">Confirm password</label>
      <input type="password" class="border-blue-300  form-control" id="inputPassword2">
    </div>

    <button type="submit" class="btn btn-primary bg-sky-700">Submit</button>
  </form>
</div>
